import React,{useState} from 'react'
import './style.css'
const Temp = () => {
    const [state, setstate] = useState("")
    return (
        <>
          <div >
             <input type="search" value={state} onChange={(data)=>setstate(data.target.value)} placeholder="search something         🔍" onMouseEnter={setstate()}></input>
          </div>  
        </>
    )
}

export default Temp
